templates.template:
// Recebe o resultado da consulta
ResultSet ${consultaVar}RS = executeCapture("${consulta}");
${consultaVar}RS.moveFirst();
${consultaVar}RS = (ResultSet) ${consultaVar}RS.getFieldValue(MEMBER_RESULTSET);
${consultaVar}RS.getRowCount();

// Verifica se existe algum resultado
if (${consultaVar}RS.getRowCount() > 0) {

	// Anda pelo primeiro elemento do ResultSet ${consultaVar}RS
	${consultaVar}RS.moveFirst();
	while (!${consultaVar}RS.isEof()) {

		// INÍCIO - Implementação sobre o resultset ${consultaVar}RS
		printOut(${consultaVar}RS.getFieldValueString(NAME));
		// FIM - Implementação sobre o resultset ${consultaVar}RS

		// Da continuidade a iteração com o ResultSet
		// ${consultaVar}RS
		${consultaVar}RS.moveNext();
	}
}

